import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        data:[]
     }
     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response);
             this.setState({
                 data: response.data
             })
         })
     }
    render() { 
        const allData = this.state.data;
        // console.log(allData);
        const checkMap = allData.map(dataCheck => {
            return(
                <div>
                    <tr key={dataCheck.id}>
                       <td>{dataCheck.id}</td>
                    </tr>
                    <tr>
                    <td>{dataCheck.name}</td>
                       <td>{dataCheck.email}</td>
                    </tr>

                </div>
            );
        })
        return ( 
            <div>
                {checkMap}
            </div>
         );
    }
}

export default Main;
